import React, { FC } from 'react'
import NavBar from './NavBar'
import Hero from './Hero'

interface HomeProps {
  windowWidth: number,
}

const Home: FC<HomeProps> = ({ windowWidth }) => {
  return (
    <div className='homeWrapper'>
      <NavBar windowWidth={windowWidth} />
      <div className='homeContent'>
        Home
      </div>
    </div>
  )
}

export default Home
